import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../style/EmployeeRegistration.css";
import AuthenticationService from "../service/AuthenticationService";

import { TextField, Button, Container, Stack } from '@mui/material';
import { Link } from "react-router-dom"

import {  Typography, CssBaseline } from '@mui/material';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles((theme) => ({
  root: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    boxShadow: '0px 3px 6px rgba(0, 0, 0, 0.1)',
    padding: theme.spacing(3),
    borderRadius: '8px',
    backgroundColor: '#fff',
  },
}));
const EmployeeRegister = () => {
  const history = useNavigate();

  const [employee, setEmployee] = useState({
    fname: "",
    lname: "",
    designation: "",
    department: "",
    password: "",
    date_of_birth: "",
    date_of_joining: "",
    phoneno: "",
    email: "",
    gender: "",
  });

  const [errors, setErrors] = useState({});
  const [successMessage, setSuccessMessage] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.includes(".")) {
      const [parent, child] = name.split(".");
      setEmployee((prevEmployee) => ({
        ...prevEmployee,
        [parent]: {
          ...prevEmployee[parent],
          [child]: value,
        },
      }));
    } else {
      setEmployee((prevEmployee) => ({
        ...prevEmployee,
        [name]: value,
      }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const validationErrors = validateForm();
    if (Object.keys(validationErrors).length === 0) {
      try {
        await AuthenticationService.registerEmployee(employee);
        setSuccessMessage("Registration successful!");
        setTimeout(() => {
          history("/login/employee");
        }, 2000);
        // Clear form or navigate to another page
      } catch (error) {
        console.error("Registration error", error);
        setSuccessMessage("An error occurred during registration.");
      }
    } else {
      setErrors(validationErrors);
    }
  };

  const validateForm = () => {
    let validationErrors = {};

    if (!employee.email) {
      validationErrors.email = "Email is required.";
    }

    if (!employee.fname) {
      validationErrors.fname = "First Name is required";
    } else if (!/^[a-zA-Z]*$/.test(employee.fname)) {
      validationErrors.fname = "Enter alphabets only";
    }

    if (!employee.lname) {
      validationErrors.lname = "Last Name is required";
    }

    if (!employee.department) {
      validationErrors.department = "DEpartment is required";
    }

    if (!employee.designation) {
      validationErrors.designation = "Designation is required";
    }

    if (!employee.gender) {
      validationErrors.gender = "Gender is required";
    }

    if (!employee.password) {
      validationErrors.password = "Password is required.";
    } else if (employee.password.length < 6) {
      validationErrors.password = "Password must be at least 6 characters.";
    }

    if (!employee.date_of_birth) {
      validationErrors.date_of_birth = "Date of Birth is required.";
    }
    if (!employee.date_of_joining) {
      validationErrors.date_of_joining = "Date of Joining is required.";
    }

    if (!employee.phoneno) {
      validationErrors.phoneno = "Phone number is required.";
    } else if (!/^\d{10}$/.test(employee.phoneno)) {
      validationErrors.phoneno =
        "Invalid phone number. Please enter a 10-digit number.";
    }

    // Add more validation rules for other fields

    return validationErrors;
  };

  return (
    <React.Fragment>
        <h2>Register Form</h2>
        <form onSubmit={handleSubmit} action={<Link to="/login" />}>
            <Stack spacing={2} direction="row" sx={{marginBottom: 4}}>
                <TextField
                    type="text"
                    variant='outlined'
                    color='secondary'
                    label="First Name"
                    value={employee.fname}
                    onChange={handleChange}
                    fullWidth
                    required
                />
                <TextField
                    type="text"
                    variant='outlined'
                    color='secondary'
                    label="Last Name"
                    value={employee.lname}
            onChange={handleChange}
                    fullWidth
                    required
                />
            </Stack>
            <TextField
                type="email"
                variant='outlined'
                color='secondary'
                label="Email"
                value={employee.email}
                onChange={handleChange}
                fullWidth
                required
                sx={{mb: 4}}
            />
           
            <TextField
                type="date"
                variant='outlined'
                color='secondary'
                label="Date of Birth (DD-MM-YYYY"
                value={employee.date_of_birth}
            onChange={handleChange}
                fullWidth
                required
                sx={{mb: 4}}
            />
            <Button variant="outlined" color="secondary" type="submit">Register</Button>
        </form>
        <small>Already have an account? <Link to="/login">Login Here</Link></small>
 
    </React.Fragment>
)

};

export default EmployeeRegister;
